edition = "2023";

package google.rpc.context;

option objc_class_prefix = "RPC";

message OriginContext {
	string remote_ip = 1;
	string origin = 2;
	string user_agent = 3;
	string accept_language = 4;
	string region_code = 5;
	string network_project = 7;
	string vnid = 8;
	string gfe_signed_request_headers = 9;
}
